import React from 'react';


function Card({id, title, subtitle, image, children, onClick}) {
  return (
    <div class="card">
      <div class="card-image clickable"
        onClick={()=>{
          onClick && onClick({id, title, subtitle, image});
        }}>
        <figure class="image is-4by3">
          <img src={image} alt={title}/>
        </figure>
      </div>
      <div class="card-content">
        <div class="media">
          <div class="media-content">
            <p class="title is-4 has-text-grey-darker">{title}</p>
            <p class="subtitle is-6 has-text-grey-light">{subtitle}</p>
          </div>
        </div>

        <div class="content">
          {children}
        </div>
      </div>
    </div>
  );
}

export default Card;
